import React from "react";
import { Box, Grid } from "@material-ui/core";
import "./styles.scss";

export default function MemberShip() {
  return (
    <Box className="container-fluid body-account">
      <Box class="container">
        <Grid container spacing={1}>
          <Grid item xs={3}></Grid>
          <Grid item xs={9}></Grid>
        </Grid>
      </Box>
    </Box>
  );
}
